bool myfunction (loc_s a,loc_s b)
{
	if (a.r < b.r)
		return true;
	if (a.r > b.r)
		return false;
	if (a.c < b.c)
		return true;
	return false; 
}

int main()
{
	int n,m,k,i,res = 0,j,tk;
	loc_s locArr[SIZE];

	scanf("%d%d%d",&n,&m,&k);
	for(i = 0; i < k; ++i)
	{
		scanf("%d%d", &locArr[i].r, &locArr[i].c);
		res = (res + arr[locArr[i].r][locArr[i].c]) % MODULU; 
	}

	sort(locArr, locArr + k, myfunction);
	res = arr[1][100] - res; 
	for(i = 0; i <= k; ++i)
	{
		
		printf("%d ", res);
	}
	
	return 0;
}
